import React, { Component } from "react";
import "../css/App.css";

class App extends Component {
  render() {
    return (
      <header>
        <img
          src="https://cdn-images-1.medium.com/max/1600/1*7rzVPQ4l8N65ktzJVz01Iw.png"
          className="responsive"
        />
      </header>
    );
  }
}

export default App;
